                                chartData.backgroundColor = 'rgba(0, 159, 255,0.75)';
                                delete chartData.borderDash
                                return chartData

             // 获取并输出指定曲线的数据
            const targetLabel = "SoundGuys Studio Curve";
            const targetDataset = chartConfig.data.datasets.find(dataset => dataset.label === targetLabel);
            if (targetDataset) {
                // 创建 CSV 内容
                let csvContent = "frequency,raw\n";
                targetDataset.data.forEach(point => {
                    csvContent += `${point.x},${point.y}\n`;
                });
                
                // 创建 Blob 对象
                const blob = new Blob([csvContent], { type: 'text/csv;charset=utf-8;' });
                const link = document.createElement("a");
                const url = URL.createObjectURL(blob);
                
                // 设置下载链接
                link.setAttribute("href", url);
                link.setAttribute("download", "SoundGuys_Studio_Curve.csv");
                link.style.visibility = 'hidden';
                document.body.appendChild(link);
                link.click();
                document.body.removeChild(link);
            } else {

            }

            chartData = null;
            Chart = null;
